import React, { useEffect } from 'react';
import RoomList from '../../components/roomList/roomList';

import './rooms.css';

function RoomsPage() {
    return (
        <div id='rooms'>
            <PageTitle 
                image="#"
                pageTitle="Rooms"
            />
            <RoomList />
        </div>
    )
}

export default RoomsPage;
